import {
  LayerGroup,
  LayersControl,
  Marker,
  Tooltip,
  TileLayer,
  Popup,
} from "react-leaflet";
import { L, Icon } from 'leaflet';
import green from '../../assets/images/green.png';
import red from '../../assets/images/red.png';
import blue from '../../assets/images/blue.png';


const Map = ({ zoom, coords }) => {

  return (
    <div>

        <TileLayer url="tiles/{z}/{x}/{y}.png" noWrap={true} />

      <Marker position={[-101, 65]} icon={new Icon({
            iconUrl: green,

            iconSize: [38, 95],
            iconAnchor: [22, 94],
            popupAnchor: [-3, -76]
      })}>
        <Popup>
          Rockholm
        </Popup>
      </Marker>

      <Marker position={[-126.5, 77.7]} icon={new Icon({
            iconUrl: green,

            iconSize: [38, 95],
            iconAnchor: [22, 94],
            popupAnchor: [-3, -76]
      })}>
        <Popup>
          Midgraad
        </Popup>
      </Marker>

      <Marker position={[-159.8, 162.2]} icon={new Icon({
            iconUrl: green,

            iconSize: [38, 95],
            iconAnchor: [22, 94],
            popupAnchor: [-3, -76]
      })}>
        <Popup>
          Ta'Lorial
        </Popup>
      </Marker>

      <Marker position={[-197.5, 134.8]} icon={new Icon({
            iconUrl: green,

            iconSize: [38, 95],
            iconAnchor: [22, 94],
            popupAnchor: [-3, -76]
      })}>
        <Popup>
          Drathguul
        </Popup>
      </Marker>

      <Marker position={[-87, 170]} icon={new Icon({
            iconUrl: green,

            iconSize: [38, 95],
            iconAnchor: [22, 94],
            popupAnchor: [-3, -76]
      })}>
        <Popup>
          Normarc
        </Popup>
      </Marker>

      <Marker position={[-159.5, 37.5]} icon={new Icon({
            iconUrl: green,

            iconSize: [38, 95],
            iconAnchor: [22, 94],
            popupAnchor: [-3, -76]
      })}>
        <Popup>
          Faas
        </Popup>
      </Marker>

      <Marker position={[-81.2, 41.5]} icon={new Icon({
            iconUrl: green,

            iconSize: [38, 95],
            iconAnchor: [22, 94],
            popupAnchor: [-3, -76]
      })}>
        <Popup>
          <a href="https://inkarnate.com/m/pZ31lv--torethia-city-of-towers/" target="_blank">Torethia</a>
        </Popup>
      </Marker>

      <Marker position={[-73, 61]} icon={new Icon({
            iconUrl: blue,

            iconSize: [38, 95],
            iconAnchor: [22, 94],
            popupAnchor: [-3, -76]
      })}>
        <Popup>
          <a href="https://inkarnate.com/m/kO5NRQ--farshire/" target="_blank">Torethia</a>
        </Popup>
      </Marker>
    </div>

  );
};
export default Map;
